import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      monsters: [
        { name: 'Dracula' },
        { name: 'Tejal' },
        { name: 'Abhishek' },
        { name: 'Mansi' },
        { name: 'Rahul' },
        { name: 'Shakuni(Jaydip)' },
      ]
    }
  }
  render() {
    return (
      <div className="App">
        <h3>Monsters of India</h3>
        {
          this.state.monsters.map((monsters, index) => {
            return (<div>{index + 1}-{monsters.name}</div>)
          })
        }
      </div>
    );
  }
}

export default App;
